import asyncio
import httpx
import base64

async def test_analyze():
    async with httpx.AsyncClient() as client:
        # Тест здоровья
        response = await client.get("http://localhost:4234/health")
        print("Health check:", response.json())
        
        # Тест анализа через путь
        form_data = {
            "image_path": "/mnt/c/Yulia/sirius/Sirius-WB-Agent/img/image.png",
            "user_query": '{"category": "shirt", "attributes": {"color": "голубой"}}'
        }
        
        response = await client.post(
            "http://localhost:4234/analyze",
            data=form_data
        )
        print("Analysis result:", response.json())

if __name__ == "__main__":
    asyncio.run(test_analyze())

